import { FC } from "react";

interface ButtonsProps {
  buttons: {
    id: string;
    name: string;
  }[];
}

const Buttons: FC<ButtonsProps> = ({ buttons }) => {
  return (
    <div>
      {buttons.map((button) => {
        return (
          <div>
            <p>{button.name}</p>
          </div>
        );
      })}
    </div>
  );
};

export default Buttons;
